import './ExpenseItems.css';

function Expenseitem() {
    return (
        <div className='expense-item'>
            <div>August 27th 2021</div>
            <div>
                <h2>Car Insurance</h2>
                <div>2,50,000/-</div>
            </div>
        </div>
    );
}

export default Expenseitem;
